:host {
  background-color: var(--primary-color);
  color: var(--text-color);
}

.item1 { grid-area: header;
    display: flex;
    justify-content: space-between;
    background-color: #1abc9c;
    height:80px;
    .head-line{
      display: flex;
       justify-content: space-between;
       width: 17rem;
      h1{
        
        @media screen and (min-width: 320px) and (max-width: 480px) {
          font-size: 14px;
        }
      }
      img{
        margin-top: 1rem;
      };
    }

    .top-nav{
      display: flex;
      flex-flow: row;
      margin: 1rem;
      .btns{
        display: flex;
        justify-content: space-between;
        width: 9rem;
        
      }
      .switch {
        position: relative;
        display: inline-block;
        width: 60px;
        height: 34px;
      }
      .switch input { 
        opacity: 0;
        width: 0;
        height: 0;
      }
      
      .slider {
        position: absolute;
        cursor: pointer;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        background-color: black;
        -webkit-transition: .4s;
        transition: .4s;
      }
      
      .slider:before {
        position: absolute;
        content: "";
        height: 26px;
        width: 26px;
        left: 4px;
        bottom: 4px;
        background-color: #1abc9c;
        -webkit-transition: .4s;
        transition: .4s;
      }    
      input:checked + .slider {
        background-color: white;
      }
      
      input:focus + .slider {
        box-shadow: 0 0 1px white;
      }
      
      input:checked + .slider:before {
        -webkit-transform: translateX(26px);
        -ms-transform: translateX(26px);
        transform: translateX(26px);
      }
      
      /* Rounded sliders */
      .slider.round {
        border-radius: 34px;
      }
      
      .slider.round:before {
        border-radius: 50%;
      }
    }
   
}
